import React, { useState } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, Card, CardContent, Typography, IconButton, TextField, Dialog, DialogActions, DialogContent, DialogTitle } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';
import AddIcon from '@mui/icons-material/Add';

export default function Profile() {
  const [shippingAddresses, setShippingAddresses] = useState([
    { id: 1, address: '123 Main St, Cityville' },
    { id: 2, address: '456 Oak St, Townsville' },
  ]);
  
  const [dialogOpen, setDialogOpen] = useState(false);
  const [currentAddress, setCurrentAddress] = useState({ id: null, address: '' });
  const [isEditing, setIsEditing] = useState(false);

  // Function to open the dialog for adding a new address
  const handleAddAddress = () => {
    setCurrentAddress({ id: null, address: '' });
    setIsEditing(false);
    setDialogOpen(true);
  };

  // Function to open the dialog for editing an existing address
  const handleEditAddress = (id) => {
    const addressToEdit = shippingAddresses.find(addr => addr.id === id);
    setCurrentAddress(addressToEdit);
    setIsEditing(true);
    setDialogOpen(true);
  };

  // Function to delete a shipping address
  const handleDeleteAddress = (id) => {
    setShippingAddresses(shippingAddresses.filter(addr => addr.id !== id));
  };

  // Function to handle saving or editing the address
  const handleSaveAddress = () => {
    if (isEditing) {
      // Update the existing address
      setShippingAddresses(shippingAddresses.map(addr => 
        addr.id === currentAddress.id ? currentAddress : addr
      ));
    } else {
      // Add the new address
      const newAddress = { id: shippingAddresses.length + 1, address: currentAddress.address };
      setShippingAddresses([...shippingAddresses, newAddress]);
    }
    setDialogOpen(false);
  };

  return (
    <div>
      <Card sx={{ padding: 2, width: '80%', marginBottom: '32px' }}>
        <CardContent>
          <Typography gutterBottom variant="h6" component="div">
            Shipping Address
          </Typography>
          <TableContainer component={Paper}>
            <Table aria-label="shipping address table">
              <TableHead>
                <TableRow>
                  <TableCell>Number</TableCell>
                  <TableCell>Shipping Address</TableCell>
                  <TableCell align="right">Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {shippingAddresses.map((addr, index) => (
                  <TableRow key={addr.id}>
                    <TableCell>{index + 1}</TableCell>
                    <TableCell>{addr.address}</TableCell>
                    <TableCell align="right">
                      <IconButton onClick={() => handleEditAddress(addr.id)}>
                        <EditIcon />
                      </IconButton>
                      <IconButton onClick={() => handleDeleteAddress(addr.id)}>
                        <DeleteIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
          <Button 
            variant="contained" 
            color="primary" 
            startIcon={<AddIcon />} 
            onClick={handleAddAddress}
            sx={{ marginTop: '16px' }}
          >
            Add New Shipping Address
          </Button>
        </CardContent>
      </Card>

      {/* Dialog for adding/editing address */}
      <Dialog open={dialogOpen} onClose={() => setDialogOpen(false)}>
        <DialogTitle>{isEditing ? "Edit Shipping Address" : "Add New Shipping Address"}</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Shipping Address"
            fullWidth
            value={currentAddress.address}
            onChange={(e) => setCurrentAddress({ ...currentAddress, address: e.target.value })}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDialogOpen(false)} color="primary">Cancel</Button>
          <Button onClick={handleSaveAddress} color="primary">
            {isEditing ? "Save Changes" : "Add Address"}
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
